import React, { Component } from 'react'
import '../../../Css/LandingPage.css'


class LandingPage extends Component {
    constructor(){
        super();
        this.handleTicket=this.handleTicket.bind(this)
    }

    handleTicket(){
        ('/Dashboard/Booking')
    }
    render() {
        return (
            <div id="landingPage">
                 <div  id="landingImage" style={{width: "60%", height: "100vh", float:"left"}}>
                     <h1>Welcome Home.</h1>
                     
                 </div>
                 <div id="landingText" style={{width: "40%",paddingTop:"200px", height: "100vh", float:"right"}}>
                    <button  onClick={this.handleTicket()} className="btn btn-primary">Book Tickets</button>
                    <button  className="btn mt-4 btn-primary">Train Status</button>

                 </div>


            </div>
        )
    }
}

export default LandingPage
